import * as React from 'react';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { purple } from '@mui/material/colors';
import Button from '@mui/material/Button';

const theme = createTheme({
  palette: {
    primary: {
      // Purple and green play nicely together.
      main: '#000000',
    },
    secondary: {
      // This is green.A700 as hex.
      main: '#000000',
    },
  },
});

theme.spacing(4);

function Palette() {
  return (
    <div class="head">
      <ThemeProvider theme={theme}>
        <Button style={{ fontSize: '10px' }} size="large"><b>home</b></Button>
        <Button size="large" color="secondary"><b>About</b></Button>
        <Button size="large" ><b>Achivements</b></Button>
        <Button size="large" ><b>Publications</b></Button>
      </ThemeProvider>
    </div>
  );
}

export default Palette
